typedef struct M10A009_Probe {
    int enabled;
    int sequence;
    int issue;
} M10A009_Probe;

M10A009_Probe m10a009_probe(void) {
#if __OBJC3_FEATURE_NULLABILITY_INVARIANT_DOCUMENTATION__
